// when player touches a static sprite changes the
// level to the next 
sprites.onOverlap(SpriteKind.Player, SpriteKind.static, function (sprite, otherSprite) {
    next_level += 1
    if (next_level < levelslist.length) {
        levels(next_level)
    } else {
        game.over(true)
    }
})
